function SearchBar() {
    const URL = "http://localhost:3000/documents"

    const searchFocDoc = () => {
        let docName = document.getElementById("header-search")
        const fd = new FormData();
        fd.append("name", docName)
        fd.append("URL", URL + "/" + docName)
        axios.post(URL, fd)
            .then(res => {
                console.log(res)
            })
            .catch((err) => {
                console.log(err);
            });
    }

    return (
        <form action="/" method="get" className="docs_header">
            <label htmlFor="header-search">
                <span className="placeholder">Search Documents</span>
            </label>
            <input
                type="text"
                id="header-search"
                placeholder="Search documents" 
            />
            <button type="submit" onClick={searchFocDoc}>Search</button>
        </form>
    );
}

export default SearchBar;
